task-name: "Image Embedding"
description: "Image embedding is a task that attempts to comprehend an entire image as a whole and encode the image's semantics into a real vector. It is a fundamental task type that can be used in a variety of applications, including but not limited to reverse image search and image deduplication."
img-credit: "Convolutional Neural Network Layers and Architectures"
img-ref: "https://www.researchgate.net/publication/333242381_Convolutional_Neural_Network_Layers_and_Architectures"
